# Info Aplikasi Kustom

## Menyesuaikan info aplikasi Anda

Anda dapat memasukkan info aplikasi Anda di properti `appInfo` untuk `RainbowKitProvider`. Properti yang dapat Anda ubah adalah nama aplikasi Anda (`appName`) dan tautan tempat tombol “Learn More” di modal koneksi mengarah ke (`learnMoreUrl`):

```tsx
import { RainbowKitProvider } from '@rainbow-me/rainbowkit';

const App = () => {
  return (
    <RainbowKitProvider
      appInfo={{
        appName: 'Rainbowkit Demo',
        learnMoreUrl: 'https://learnaboutcryptowallets.example',
      }}
      {...etc}
    >
      {/* ... */}
    </RainbowKitProvider>
  );
};
```

### Tambahkan Penafian

Anda dapat memberikan penafian Anda sendiri untuk ditampilkan di bagian bawah modal koneksi. Properti `disclaimer` dalam `appInfo` mengambil `DisclaimerComponent` dengan argumen `Text` dan `Link`. Anda dapat menggunakannya untuk membangun penafian Anda sendiri yang mewarisi sistem tematik. Kami mengekspor tipe `DisclaimerComponent` untuk pengguna TypeScript:

```tsx
import {
  RainbowKitProvider,
  DisclaimerComponent,
} from '@rainbow-me/rainbowkit';

const Disclaimer: DisclaimerComponent = ({ Text, Link }) => (
  <Text>
    By connecting your wallet, you agree to the{' '}
    <Link href="https://termsofservice.xyz">Terms of Service</Link> and
    acknowledge you have read and understand the protocol{' '}
    <Link href="https://disclaimer.xyz">Disclaimer</Link>
  </Text>
);

const App = () => {
  return (
    <RainbowKitProvider
      appInfo={{
        appName: 'RainbowKit Demo',
        disclaimer: Disclaimer,
      }}
      {...etc}
    >
      {/* ... */}
    </RainbowKitProvider>
  );
};
```
